import React from 'react';
import './css/Form.css';

export default class Form extends React.Component{
    render(){
        return(
            <header className="form-render">
                <p>Orange</p>
                <form>
                    <p>Email</p>
                    <input type="text"/>
                    <p>Senha</p>
                    <input type="text"/>
                    <input type="checkbox" /> Mostrar senha
                </form>
            </header>
        );
    }
}
